import Link from "next/link";

const ResourceBookLayout = props => (
  <div className="card">
    <div class="card-image">
      <figure className="image">
        <img src={props.src} alt="Image of paper booklet" />
      </figure>
      <p>DWL</p>
    </div>
  </div>
);

export default ResourceBookLayout;
